import React, { Component } from 'react'
import Foother from './Footer'
import Header from './Header'
import Mrc from './Mrc'

class ShowPatientMrc extends Component{

    constructor(props) {
        super(props)
    }

    render(){
        return(
            <main>
                <a href="/UploadEMR" style={{padding: "40px"}}>
                    <img src="/images/icon_upload.png" width="50px" height="50px" class="d-inline-block align-top" alt="" />
                        <b>Add a new EMR</b></a>

            <Header account={this.props.location.state.account} />
              <Mrc account = {this.props.location.state.account} />
            <br></br>
            <Foother/>
            </main>
        );
    }


}

export default ShowPatientMrc;
